INSERT INTO `paginas` (`id`, `title`, `body`, `created`, `modified`, `user_id`, `categorie_id`, `filename`, `filename_dir`, `iframe`, `videoemveb`, `paramenu`, `urlpdf`, `slider_id`, `area_id`, `secperson_id`) VALUES
(1, 'Misión y Visión', '<h2>Visi&oacute;n</h2>\r\n\r\n<p>&ldquo;Los ciudadanos y ciudadanas de la Unidad Ejecutora 304 Educaci&oacute;n Pachitea han desarrollado competencias para desempe&ntilde;arse con existo en su entorno, con una educaci&oacute;n equitativa y de calidad, respetuosa de la diversidad cultural, promotora del arte, la ciencia y la conciencia ambiental as&iacute; como de la construcci&oacute;n del desarrollo sostenible de la provincia de Pachitea&rdquo;.&nbsp; &nbsp;</p>\r\n\r\n<h2>Misi&oacute;n</h2>\r\n\r\n<p>&ldquo;Garantizar un servicio Educativo de calidad, en todos los niveles y modalidades del Sistema Educativo de nuestro &aacute;mbito jurisdiccional, promoviendo la formaci&oacute;n integral y desarrollo de la identidad y autoestima del educando, que facilite su integraci&oacute;n social con h&aacute;bitos de aprendizaje permanente acorde a los cambios cient&iacute;fico tecnol&oacute;gico, as&iacute; como a las exigencias del mundo globalizado y gestionar recursos financieros, de personal, infraestructura, desarrollo de tecnolog&iacute;as educativas y todo aquello de sirve de soporte a la mejora permanente del servicio educativo&rdquo;&nbsp;</p>\r\n', '2016-11-08 18:15:54', '2017-07-18 15:26:25', 1, 4, 'MisionVision1.png', '1', '', '', 0, '', NULL, 3, 3),
(2, 'Estructura Orgánica', '', '2016-11-08 18:52:31', '2016-11-23 16:31:22', 1, NULL, '', '', '', '', 0, '', NULL, 3, 3),
