(11, 'Libro de Reclamaciones', '<p>&nbsp;</p>\r\n<div id="div_cabecera" class="div_cabecera" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #c4f89c; color: #1c1c1c;" align="center">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Ley N&ordm; 27444</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">DECRETO SUPREMO N&ordm; 042-2011-PCM</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Obligaci&oacute;n de las Entidades del Sector P&uacute;blico de contar con un Libro de Reclamaciones</p>\r\n</div>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<div id="div_aviso" class="div_aviso" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;" align="center">A continuaci&oacute;n se le presenta el libro de reclamaciones virtual a trav&eacute;s del cual los usuarios podr&aacute;n consignar sus reclamos, entendido como una expresi&oacute;n de insatisfacci&oacute;n o disconformidad del usuario respecto de un servicio de atenci&oacute;n brindado por la entidad p&uacute;blica, diferente a la Queja por Defecto de Tramitaci&oacute;n.</div>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<fieldset style="box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; min-width: 0px; background-color: #e6e6e6; border: 0px initial initial;"><legend style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border-width: 0px 0px 1px; border-bottom-color: #e5e5e5; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 21px; font-family: inherit; vertical-align: baseline; width: 862px; line-height: inherit; color: #333333; border-style: initial initial solid initial;">1. Identificaci&oacute;n del Usuario:</legend>\r\n<div id="div_izquierda" class="div_izquierda" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; float: left; width: 344.797px;" align="right">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Nombre:</p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Domicilio:</p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">DNI / CE:</p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Tel&eacute;fono:</p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Email:</p>\r\n</div>\r\n<div id="div_derecha" class="div_derecha" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; float: right; width: 517.188px;" align="left">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="txt_nombre"></label>&nbsp;<input id="txt_nombre" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; border-color: #000000; border-style: solid;" name="txt_nombre" required="" type="text" /></p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="txt_domicilio"></label>&nbsp;<input id="txt_domicilio" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; border-color: #000000; border-style: solid;" name="txt_domicilio" required="" type="text" /></p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="txt_dni"></label>&nbsp;<input id="txt_dni" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; border-color: #000000; border-style: solid;" maxlength="8" name="txt_dni" required="" type="text" placeholder="Ingrese 8 d&iacute;gitos" /></p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="txt_telefono"></label>&nbsp;<input id="txt_telefono" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; border-color: #000000; border-style: solid;" name="txt_telefono" type="text" /></p>\r\n<br style="box-sizing: border-box;" />\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="txt_email"></label>&nbsp;<input id="txt_email" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; border-color: #000000; border-style: solid;" name="txt_email" required="" type="text" /></p>\r\n</div>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">&nbsp;</p>\r\n</fieldset>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<fieldset style="box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; min-width: 0px; background-color: #e6e6e6; border: 0px initial initial;"><legend style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border-width: 0px 0px 1px; border-bottom-color: #e5e5e5; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 21px; font-family: inherit; vertical-align: baseline; width: 862px; line-height: inherit; color: #333333; border-style: initial initial solid initial;">2. Identificaci&oacute;n de la Atenci&oacute;n Brindada</legend>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="atxt_descripcion"></label>&nbsp;<textarea id="atxt_descripcion" style="box-sizing: border-box; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; overflow: auto; width: 700px; border-color: #000000;" name="atxt_descripcion" rows="10"></textarea></p>\r\n</fieldset>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6; text-align: center;"><input id="btn_enviar" style="border-radius: 10px; -webkit-appearance: button; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: inherit; color: #cccccc; background: #666666; width: 100px; height: 30px; border: initial none initial;" disabled="disabled" name="btn_enviar" type="submit" value="Enviar" /></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<div id="div_respuesta" class="div_respuesta" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #333333;" align="center">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #cccccc; display: inline-block; max-width: 100%;">La respuesta a su reclamo ser&aacute; enviada al correo electr&oacute;nico que registre, en un plazo m&aacute;ximo de treinta (30) d&iacute;as h&aacute;biles.</label></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #cccccc; display: inline-block; max-width: 100%;">Cualquier consulta a su reclamo podr&aacute; llamar al tel&eacute;fono (062) 513488 &oacute; (062) 512124 Anexo: 105, Secretar&iacute;a General e Imagen Institucional, o al correo ntoledo@regionhuanuco.gob.pe</label></p>\r\n</div>', '2016-11-11 10:14:27', '2016-11-11 10:14:27', 1, NULL, '', '', '', '', 0, NULL, NULL, 3, 3),
(12, 'Consultas y sugerencias', '<div id="div_cabecera" class="div_cabecera" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #c4f89c; color: #1c1c1c;" align="center">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><span style="box-sizing: border-box; color: #000000; font-weight: bold;">FORMULARIO DE SUGERENCIAS Y PEDIDOS<br style="box-sizing: border-box;" /></span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div id="div_sumilla" class="div_sumilla espacio_izquierda" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;" align="center">\r\n<div id="div_form" class="div_form" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;">\r\n<div id="div_izq" class="div_izq" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; width: 431px; float: left; text-align: left; background: #d1d7dc;"><br style="