: 0px; margin: 0px;">\r\n<li style="box-sizing: border-box; height: 30px; list-style-type: none; color: #006699;"><input id="txt_dni" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; height: 20px; border-color: #000000;" title="8 d&iacute;gitos num&eacute;ricos" maxlength="8" name="txt_dni" pattern="[0-9]{8}" required="" type="text" placeholder="Ingrese s&oacute;lo d&iacute;gitos" /></li>\r\n<li style="box-sizing: border-box; height: 30px; list-style-type: none; color: #006699;"><input id="txt_nombres" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; height: 20px; border-color: #000000;" name="txt_nombres" required="" type="text" /></li>\r\n<li style="box-sizing: border-box; height: 30px; list-style-type: none; color: #006699;"><input id="txt_paterno" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; height: 20px; border-color: #000000;" name="txt_paterno" required="" type="text" /></li>\r\n<li style="box-sizing: border-box; height: 30px; list-style-type: none; color: #006699;"><input id="txt_materno" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; height: 20px; border-color: #000000;" name="txt_materno" required="" type="text" /></li>\r\n<li style="box-sizing: border-box; height: 30px; list-style-type: n