INSERT INTO `bookmarks` (`id`, `user_id`, `title`, `description`, `url`, `created`, `modified`, `categorie_id`, `filename`, `filename_dir`, `slider_id`, `widget_id`, `resumen`, `area_id`, `con_image1`, `secperson_id`, `videoiframe`) VALUES
(613, 1, 'Más de 180 Trabajadores de Construcción Civil fueron certificados por SENCICO', '<p>Con el compromiso de continuar trabajando en promoci&oacute;n del ejercicio de capacitaci&oacute;n y certificaci&oacute;n a los obreros de construcci&oacute;n civil, la Direcci&oacute;n Regional de Trabajo y Promoci&oacute;n del Empleo y el Gobierno Regional Hu&aacute;nuco realizaron el pasado, 14 de noviembre la entrega del certificado ocupacional, del curso de &ldquo;Seguridad y Salud ocupacional&rdquo; brindado y certificado por SENCICO (Servicio Nacional de Capacitaci&oacute;n para la Industria de Construcci&oacute;n).</p>\r\n\r\n<p>Mencionado curso fue realizado el 09 y 10 de julio, en las instalaciones del auditorio de la Direcci&oacute;n Regional de Transportes y Comunicaciones a m&aacute;s de 180 trabajadores de este rubro.</p>\r\n\r\n<p>La entrega y reconocimiento estuvo a cargo del Ing. Ruben Alva Ochoa Gobernador Regional de Hu&aacute;nuco, y la Mg. Ena Espinoza Ca&ntilde;oli Directora Regional de Trabajo quienes manifestaron sus compromisos en responsabilidad por la seguridad y la salud de los trabajadores&nbsp; de este rubro.</p>\r\n', '', '2016-11-23 17:25:07', '2017-07-05 05:35:29', 0, 'trabajadores-certificados-por-sencico-01.jpg', '613', 6, 2, 'Con el compromiso de continuar trabajando en promoción del ejercicio de capacitación y certificación a los obreros de construcción civil, la Dirección Regional de Trabajo y Promoción del Empleo y el Gobierno Regional Huánuco realizaron el pasado, 14 de noviembre la entrega del certificado ocupacional, del curso de “Seguridad y Salud ocupacional” brindado y certificado por SENCICO (Servicio Nacional de Capacitación para la Industria de Construcción).', 3, NULL, 3, NULL),
(614, 1, 'Huánuco mejorá 99 colegios de Inicial con S/ 111 millones', '<p>Un grupo de 99 colegios de inicial de Hu&aacute;nuco han sido mejorados en su infraestructura con los S/ 111 millones 570 mil transferidos por el Ministerio de Educaci&oacute;n (Minedu) entre el a&ntilde;o 2011 a mayo del 2016, beneficiando a m&aacute;s de 3400 ni&ntilde;os de 3 a 5 a&ntilde;os de edad.</p>\r\n\r\n<p>As&iacute; lo inform&oacute; el Programa Nacional de Infraestructura Educativa (PRONIED), del Minedu, en el marco del 85 aniversario de la Educaci&oacute;n Inicial en el Per&uacute;.</p>\r\n\r\n<p>El PRONIED indic&oacute; que el monto fue transferido a las autoridades del gobierno regional y varios municipios de Hu&aacute;nuco para que ejecuten obras de mejoramiento, ampliaci&oacute;n, refacci&oacute;n, instalaci&oacute;n y construcci&oacute;n de colegios p&uacute;blicos de nivel inicial, incluyendo el equipamiento con m&oacute;dulos de juegos recreativos.</p>\r\n\r\n<p>Las 99 obras han estado a cargo del Gobierno Regional de Hu&aacute;nuco, Municipalidad Provincial de Hu&aacute;nuco, Municipalidad Distrital de Cahuac, Municipalidad Distrital de Quivilla, Municipalidad Distrital de Luyando, Municipalidad Provincial de Huacaybamba, Municipalidad Distrital de Miraflores y la Municipalidad Distrital de Chav&iacute;n de Pariarca.</p>\r\n\r\n<p>Tambi&eacute;n han ejecutado obras educativas la Municipalidad Provincial de Pachitea, Municipalidad Provincial de Lauricocha, Municipalidad Distrital de Monz&oacute;n, Municipalidad Distrital de Rip&aacute;n, Municipalidad Provincial de Puerto Inca, Municipalidad Distrital de Pu&ntilde;os y la Municipalidad Provincial de Huacaybamba.</p>\r\n\r\n<p>El PRONIED estim&oacute; que el 70% de los colegios mejorados entre el 2011 a la fecha est&aacute;n ubicados en las zonas rurales de Hu&aacute;nuco, atendiendo as&iacute; a la poblaci&oacute;n escolar m&aacute;s alejada.</p>\r\n\r\n<p>Transferencias</p>\r\n\r\n<p>El PRONIED indic&oacute; que los recursos fueron entregados bajo el esquema de transferencias condicionadas, en el sentido de entregar recursos en funci&oacute;n al cumplimiento de metas por parte de los gobiernos subnacionales, a fin de cautelar el uso correcto del dinero.</p>\r\n\r\n<p>Asimismo, durante la ejecuci&oacute;n de obras a cargo de los gobiernos subnacionales, el PRONIED realiza el acompa&ntilde;amiento t&eacute;cnico y monitoreo de la ejecuci&oacute;n de esta inversi&oacute;n.</p>\r\n\r\n<p>El PRONIED recuerda que todos los procedimientos para la transferencia de recursos est&aacute;n bajo el escrutinio de la Contralor&iacute;a General de la Rep&uacute;blica, garantiz&aacute;ndose la correcta administraci&oacute;n de los recursos p&uacute;blicos destinados al cierre de la brecha de la infraestructura educativa p&uacute;blica en el pa&iacute;s.</p>\r\n', '', '2017-06-19 22:14:50', '2017-07-05 05:35:41', 0, 'imagen2.jpg', '614', NULL, 2, 'Un grupo de 99 colegios de inicial de Huánuco han sido mejorados en su infraestructura con los S/ 111 millones 570 mil transferidos por el Ministerio de Educación (Minedu) entre el año 2011 a mayo del 2016, beneficiando a más de 3400 niños de 3 a 5 años de edad.\r\n\r\nAsí lo informó el Programa Nacional de Infraestructura Educativa (PRONIED), del Minedu, en el marco del 85 aniversario de la Educación Inicial en el Perú.', 3, NULL, 3, NULL),
(615, 1, 'Invierten más de s/24 millones en educación', '<p>La Unidad Ejecutora 118 del Ministerio de Educaci&oacute;n (Minedu), a trav&eacute;s del Programa de Mejoramiento de la Educaci&oacute;n Inicial, tiene como fin para el primer semestre del 2018 construir 65 colegios de educaci&oacute;n inicial en la provincia huanuque&ntilde;a de Pachitea.</p>\r\n\r\n<p>En ese sentido, la Unidad Ejecutora ha hecho entrega al Gobierno Regional de Hu&aacute;nuco (Gorehco) de trece modernas infraestructuras educativas de educaci&oacute;n inicial al servicio de la ni&ntilde;ez de los centros poblados de los distritos de Molino y Chaglla.</p>\r\n\r\n<p>El monto de inversi&oacute;n de dichas obras asciende a S/24 millones 606 mil puesto que se han realizado contemplando todas las comodidades y medidas de seguridad necesarias para el desarrollo de los ni&ntilde;os, inform&oacute; el Gorehco a INFOREGI&Oacute;N.</p>\r\n\r\n<p>Los colegios tiene aulas pedag&oacute;gicas, servicios higi&eacute;nicos, cuarto de limpieza, dep&oacute;sito de material educativo; sal&oacute;n de usos m&uacute;ltiples, con cocina y dep&oacute;sito de alimentos; una direcci&oacute;n, t&oacute;pico, archivo, sala de espera, servicios higi&eacute;nicos para docente; cerco perim&eacute;trico, patio duro, &aacute;rea de circulaci&oacute;n, zonas de juego, tanque de agua, biodigestor y &aacute;reas verdes; un ambiente para docente, dormitorio, cocina, servicio higi&eacute;nico y ducha.</p>\r\n\r\n<p>Adem&aacute;s, est&aacute;n equipados con muebles para aulas pedag&oacute;gicas, sillas y mesas para ni&ntilde;os, escritorios para docente, sillas para docentes, estantes, juegos recreativos para ni&ntilde;os (tobog&aacute;n, casita, sube baja, entre otros); equipamiento con computadora, impresora multifuncional, televisor, cocina con horno, licuadora y menajer&iacute;a; adem&aacute;s de un pararrayos.</p>\r\n\r\n<p>Finalmente, se report&oacute; que siete obras m&aacute;s se encuentran en ejecuci&oacute;n y en poco tiempo ser&aacute;n entregadas por la Unidad Ejecutora 118 al Gobierno Regional de Hu&aacute;nuco.</p>\r\n', '', '2017-06-19 22:16:32', '2017-07-05 05:35:51', 0, 'imagen1.jpg', '615', NULL, 2, 'La Unidad Ejecutora 118 del Ministerio de Educación (Minedu), a través del Programa de Mejoramiento de la Educación Inicial, tiene como fin para el primer semestre del 2018 construir 65 colegios de educación inicial en la provincia huanuqueña de Pachitea.\r\n\r\nEn ese sentido, la Unidad Ejecutora ha hecho entrega al Gobierno Regional de Huánuco (Gorehco) de trece modernas infraestructuras educativas de educación inicial al servicio de la niñez de los centros poblados de los distritos de Molino y Chaglla', 3, NULL, 3, NULL),
(616, 1, 'Huánuco invierte más de S/. 5 millones en construcción de colegio en Pachitea', '<p>El gobierno regional de Hu&aacute;nuco inaugur&oacute; la instituci&oacute;n educativa Jos&eacute; Antonio Encinas, en el distrito de Chaglla, provincia huanuque&ntilde;a de Pachitea y en cuya construcci&oacute;n se invirti&oacute; 5 millones 185,000 nuevos soles, se inform&oacute; hoy.<br />\r\nEl presidente regional de Hu&aacute;nuco, Luis Pic&oacute;n, fue el encargado de inaugurar el plantel que cuenta con 15 aulas, servicios higi&eacute;nicos, un cafet&iacute;n, campos deportivos, ambientes administrativos, un laboratorio m&uacute;ltiple, una biblioteca, una sala de c&oacute;mputo, una sala de educaci&oacute;n f&iacute;sica y escaleras.<br />\r\nEl plantel educativo tambi&eacute;n tiene &aacute;reas verdes, un auditorio, una sala de taller audiovisual, una sala de innovaci&oacute;n pedag&oacute;gica, &nbsp;95 equipos de c&oacute;mputo, 859 unidades de mobiliario, cerco perim&eacute;trico y acceso vehicular.<br />\r\nEntre aplausos de alumnos y padres de familia, la autoridad regional, que estuvo acompa&ntilde;ado de la alcaldesa de Chaglla, &nbsp;Mercedes Tolentino destac&oacute; el trabajo de su gesti&oacute;n a favor de la educaci&oacute;n en dicha regi&oacute;n.</p>\r\n', '', '2017-06-19 22:19:04', '2017-07-05 05:35:59', 0, 'slider3.jpg', '616', NULL, 2, 'El gobierno regional de Huánuco inauguró la institución educativa José Antonio Encinas, en el distrito de Chaglla, provincia huanuqueña de Pachitea y en cuya construcción se invirtió 5 millones 185,000 nuevos soles, se informó hoy.\r\nEl presidente regional de Huánuco, Luis Picón, fue el encargado de inaugurar el plantel que cuenta con 15 aulas, servicios higiénicos, un cafetín, campos deportivos, ambientes administrativos, un laboratorio múltiple, una biblioteca, una sala de cómputo, una sala de educación física y escaleras.', 3, NULL, 3, NULL),
(617, 1, 'COMUNICADO: LISTA DE  DOCENTES A SER EVALUADOS', '<p>Listado de docentes a ser evaluados en los desempe&ntilde;os a nivel inicial en la UGEL-PACHITEA-2017</p>\n\n<iframe src="https://drive.google.com/file/d/0B4GwxLE7oTIRQmxmY0hKV3R2c25ZUzJ2bnM1RFNEb1RubnhR/preview" width="640" height="480"></iframe>\n', '', '2017-07-18 16:17:31', '2017-07-18 16:20:29', 0, 'nuew.jpg', '617', NULL, 2, 'Listado de docentes a ser evaluados en los desempeños a nivel inicial en la UGEL-PACHITEA-2017', 3, NULL, 3, NULL);
