INSERT INTO `paginas` (`id`, `title`, `body`, `created`, `modified`, `user_id`, `categorie_id`, `filename`, `filename_dir`, `iframe`, `videoemveb`, `paramenu`, `urlpdf`, `slider_id`, `area_id`, `secperson_id`) VALUES
(1, 'Misión y Visión', '<h2>Visi&oacute;n</h2>\r\n\r\n<p>&ldquo;Los ciudadanos y ciudadanas de la Unidad Ejecutora 304 Educaci&oacute;n Pachitea han desarrollado competencias para desempe&ntilde;arse con existo en su entorno, con una educaci&oacute;n equitativa y de calidad, respetuosa de la diversidad cultural, promotora del arte, la ciencia y la conciencia ambiental as&iacute; como de la construcci&oacute;n del desarrollo sostenible de la provincia de Pachitea&rdquo;.&nbsp; &nbsp;</p>\r\n\r\n<h2>Misi&oacute;n</h2>\r\n\r\n<p>&ldquo;Garantizar un servicio Educativo de calidad, en todos los niveles y modalidades del Sistema Educativo de nuestro &aacute;mbito jurisdiccional, promoviendo la formaci&oacute;n integral y desarrollo de la identidad y autoestima del educando, que facilite su integraci&oacute;n social con h&aacute;bitos de aprendizaje permanente acorde a los cambios cient&iacute;fico tecnol&oacute;gico, as&iacute; como a las exigencias del mundo globalizado y gestionar recursos financieros, de personal, infraestructura, desarrollo de tecnolog&iacute;as educativas y todo aquello de sirve de soporte a la mejora permanente del servicio educativo&rdquo;&nbsp;</p>\r\n', '2016-11-08 18:15:54', '2017-07-18 15:26:25', 1, 4, 'MisionVision1.png', '1', '', '', 0, '', NULL, 3, 3),
(2, 'Estructura Orgánica', '', '2016-11-08 18:52:31', '2016-11-23 16:31:22', 1, NULL, '', '', '', '', 0, '', NULL, 3, 3),
(3, 'Trámites', '<p style="text-align: center;">&nbsp;<a style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background: #c4f89c; color: #25282a; text-decoration: none; text-align: center;" href="http://www.regionhuanuco.gob.pe/gorehco/fut.pdf" target="_blank"><img style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: middle;" src="http://www.regionhuanuco.gob.pe/gorehco/img/pdf.png" />&nbsp;Descargar FUT</a></p>\r\n<div id="div_sumilla" class="div_sumilla espacio_izquierda" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;" align="center">\r\n<table style="box-sizing: border-box; border-collapse: collapse; border-spacing: 0px; background-color: transparent; font-weight: bold;" border="1" width="722" align="center">\r\n<tbody style="box-sizing: border-box;">\r\n<tr style="box-sizing: border-box;">\r\n<td class="celda1" style="box-sizing: border-box; text-align: right; font-weight: normal; padding: 0px; color: #006699; background-color: #d1d7dc;" width="294"><label id="lbl_sumilla" class="col1" style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-size: 16px; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="txt_sumilla">Sumilla(*):</label></td>\r\n<td style="box-sizing: border-box; font-weight: normal; padding: 0px;" width="420"><input id="txt_sumilla" class="text1" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; width: 400px;" name="txt_sumilla" required="" type="text" placeholder="Escriba el asunto de su solicitud" /></td>\r\n</tr>\r\n<tr style="box-sizing: border-box;">\r\n<td class="celda1" style="box-sizing: border-box; text-align: right; font-weight: normal; padding: 0px; color: #006699; background-color: #d1d7dc;"><label id="lbl_dependencia" class="col1" style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-size: 16px; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;" for="sel_dependencia2">Dependencia o autoridad a quien se dirige(*):<br style="box-sizing: border-box;" /><br style="box-sizing: border-box;" />Nombre del representante a quien se dirige (opcional):</label></td>\r\n<td style="box-sizing: border-box; font-weight: normal; padding: 0px;">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;"><select id="sel_oficina" style="margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; width: 400px;" name="sel_oficina" required="">&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="">Seleccione</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="1">Consejo Regional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="2">Secretar&iacute;a del consejo Regional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="3">Presidencia Regional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="4">Vice Presidencia Regional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="5">&Oacute;rgano de Control Institucional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="6">Procuradur&iacute;a P&uacute;blica Regional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="9">Oficina Regional de Gesti&oacute;n en Conflictos Sociales</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="10">Oficina Regional de Defensa Nacional, Defensa Civil y Seguridad Ciudadana</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="11">Gerencia General Regional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="12">Oficina Regional de Cooperaci&oacute;n Internacional</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;\r\n<option style="box-sizing: border-box;" value="13">Oficina Regional de Asesor&iacute;a Jur&iacute;dica</option>\r\n&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&