(11, 'Libro de Reclamaciones', '<p>&nbsp;</p>\r\n<div id="div_cabecera" class="div_cabecera" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #c4f89c; color: #1c1c1c;" align="center">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Ley N&ordm; 27444</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">DECRETO SUPREMO N&ordm; 042-2011-PCM</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 14px; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">Obligaci&oacute;n de las Entidades del Sector P&uacute;blico de contar con un Libro de Reclamaciones</p>\r\n</div>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<div id="div_aviso" class="div_aviso" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;" align="center">A continuaci&oacute;n se le presenta el libro de reclamaciones virtual a trav&eacute;s del cual los usuarios podr&aacute;n consignar sus reclamos, entendido como una expresi&oacute;n de insatisfacci&oacute;n o disconformidad del usuario respecto de un servicio de atenci&oacute;n brindado por la entid