;" /><input id="txt_captcha" style="box-sizing: border-box; border-radius: 0px; -webkit-appearance: none; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; height: 20px; border-color: #000000;" name="txt_captcha" required="" type="text" placeholder="Ingrese el n&uacute;mero de la imagen" /></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">&nbsp;</p>\r\n</div>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;" align="center"><input id="btn_enviar" style="border-radius: 10px; -webkit-appearance: button; margin: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: inherit; color: white; cursor: pointer; background: #006699; width: 100px; height: 30px; border: initial none initial;" name="btn_enviar" type="submit" value="Enviar" /></p>\r\n<p>&nbsp;</p>\r\n<div id="div_respuesta" class="div_respuesta" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #333333;" align="center">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #777777; line-height: 1.6em;">&nbsp;</p>\r\n<h3 style="box-sizing: border-box; font-family: fantasy; margin: 0.2em 0px; padding: 0px; font-weight: normal; color: white; font-size: 1.6em; line-height: 1.1;">Su sugerencia ser&aacute; recibida por la Lic. Norma Toledo Minaya de Salazar, responsable de brindar la Informaci&oacute;n P&uacute;blica de acuerdo a la&nbsp;<a style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 22.4px; font-family: inherit; vertical-align: baseline; background: transparent; color: #00ffff;" href="http://www.regionhuanuco.gob.pe/gorehco/archivos/regulations/2015/00/002003042015.pdf" target="_blank">Resoluci&oacute;n Ejecutva Regional N&deg; 304 - 2015 - GRH/PR.</a>&nbsp;Podr&aacute; comunicarse a los correos: ntoledo@regionhuanuco.gob.pe, sistemas@regionhuanuco.gob.pe</h3>\r\n</div>', '2016-11-11 10:16:41', '2016-11-11 10:16:41', 1, NULL, '', '', '', '', 0, NULL, NULL, 3, 3),
(13, 'Denuncias en Linea', '<p>&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<div id="div_form" class="div_form" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;" align="center">\r\n<h2 style="box-sizing: border-box; font-family: inherit; margin: 0.2em 0px; padding: 0px; font-weight: normal; color: #444444; font-size: 2em; line-height: 1.1;">DESCARGAR EL FORMATO:</h2>\r\n<label style="box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-weight: bold; font-style: inherit; font-family: Roboto; vertical-align: baseline; color: #25282a; display: inline-block; max-width: 100%;">Descargue el formato a ser llenado:</label><a style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; background: transparent; color: #428bca; text-decoration: none;" href="http://www.regionhuanuco.gob.pe/gorehco/archivos/atencion-al-ciudadano/formato%20denuncias%20GRH.doc"><img style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: middle;" src="http://www.regionhuanuco.gob.pe/gorehco/img/descarga.png" width="32" height="32" />Formato de Denuncias y quejas</a></div>\r\n<p>&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<h2 style="box-sizing: border-box; font-family: sans-serif; margin: 0.2em 0px; padding: 0px; font-weight: normal; color: #444444; font-size: 2em; line-height: 1.1; background-color: #e6e6e6;" align="center">REQUISITOS PARA LA PRESENTACION Y ATENCION DE LA DENUNCIAS</h2>\r\n<p>&nbsp;</p>\r\n<div style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;" align="justify">\r\n<ol style="box-sizing: border-box; list-style: none; padding: 0px; margin: 0px;">\r\n<ol style="box-sizing: border-box; list-style: none; padding: 0px; margin: 0px;">\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">Las denuncias se efectuar&aacute;n en forma directa y por escrito, de manera personal o por correo postal. Asimismo podr&aacute;n realizarse verbalmente, en cuyo caso debe ser formalizada.</li>\r\n</ol>\r\n</ol>\r\n<br style="box-sizing: border-box;" />\r\n<ol style="box-sizing: border-box; list-style: none; padding: 0px; margin: 0px;">\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">El recurrente deber&aacute; llenar un formulario para presentar la denuncia, la cual contendr&aacute; la siguiente informaci&oacute;n</li>\r\n</ol>\r\n<br style="box-sizing: border-box;" />\r\n<ol id="ol_a_datos" style="box-sizing: border-box; list-style: none; padding: 0px; margin: 0px 0px 0px 30px;" type="a">\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">Los nombres y apellidos completos, domicilio, n&uacute;mero telef&oacute;nico, e-mail del denunciante o de la persona que lo represente, acompa&ntilde;&aacute;ndose copia de respectivo documento de identidad. Los representantes de personas jur&iacute;dicas deber&aacute;n acreditar su condici&oacute;n mediante poder o documento con m&eacute;rito suficiente.</li>\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">La exposici&oacute;n detallada y precisa de los hechos relativos a los actos u operaciones que constituyan la presunta irregularidad o anomal&iacute;, que permita su comprobaci&oacute;n, con indicaci&oacute;n de fechas y lugares, as&iacute; como fuentes de informaci&oacute;n y montos involucrados si fuera el caso.</li>\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">Los datos con que se cuente para la individualizaci&oacute;n de los participes y/o testigos de la presunta irregularidad denunciada.</li>\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">Las pruebas pertinentes, adjunt&aacute;ndolas en copia simple; o la indicaci&oacute;n de la correspondiente evidencia identificable y sus caracter&iacute;sticas o lugar de ubicaci&oacute;n para acceder a ella.</li>\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">Compromiso del denunciante para permanecer a disposici&oacute;n del Organo Regional de Control Institucional de Piura a fin de brindar las aclaraciones o mayor informaci&oacute;n disponible a que hubiere lugar.</li>\r\n<li style="box-sizing: border-box; margin-left: 50px; margin-right: 10px;">Lugar, fecha o impresi&oacute;n digital.</li>\r\n</ol>\r\n</div>\r\n<p><br style="box-sizing: border-box; font-family: sans-serif; font-size: 14px; background-color: #e6e6e6;" /><span style="font-family: sans-serif; font-size: 14px; background-color: #e6e6e6;">Nota: Los hechos materia de la denuncia deben ser expuestos en forma detallada, coherente y fundamentada, adjunt&aacute;ndose o indic&aacute;ndose la informaci&oacute;n o documentaci&oacute;n necesaria que permita su evaluaci&oacute;n</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; color: #777777; line-height: 1.6em; background-color: #e6e6e6;">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;">De acuerdo a la resoluci&oacute;n "Servicio de Atenci&oacute;n de Denuncias"&nbsp;<a style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; background: transparent; color: #428bca; text-decoration: none;" href="http://www.regionhuanuco.gob.pe/portal/archivos/regulations/2003/12/9990004432003_1432316179.pdf" target="_blank"><img style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: middle;" src="http://www.regionhuanuco.gob.pe/gorehco/img/pdf.png" />Resoluci&oacute;n de Contralor&iacute;a N&deg; 443-2003-DG</a></div>\r\n<div id="" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: sans-serif; vertical-align: baseline; background-color: #e6e6e6;" align="center">Jefe de la oficina del &Oacute;rgano de Control Interno del Gobierno Regional de Hu&aacute;nuco: CPC.JOS&Eacute; ANTONIO ARREDONDO CRISTOBAL<br style="box-sizing: border-box;" />Email: jarredondo@regionhuanuco.gob.pe<br style="box-sizing: border-box;" />Tel&eacute;fono: (062) 512124 Anexo 113</div>', '2016-11-11 10:18:10', '2016-11-11 10:18:10', 1, NULL, '', '', '', '', 0, NULL, NULL, 3, 3),
