(33, 'Directorio Institucional', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-07-04 04:59:41', '2017-09-22 02:41:54', 1, 4, '', '', 'https://onedrive.live.com/embed?cid=3274BCC8EAAF5944&resid=3274BCC8EAAF5944%21273&authkey=AK8wIiLxVByYzM0&em=2" width="402" height="346" frameborder="0" scrolling="no"', '', 0, '', NULL, 3, 3),
(34, 'Dirección', '<p><strong>Director:&nbsp;Crespo Cespedes Nolberto&nbsp;<a href="http://www.ugel03.gob.pe/wp-content/uploads/2016/01/RD-Directora.pdf" target="_blank">(Seg&uacute;n RDR N&deg; 005245-2016)</a></strong></p>\r\n\r\n<p><a href="http://www.ugel03.gob.pe/wp-content/uploads/2016/01/RM-N%C2%B0-215-2015.pdf" target="_blank">Resoluci&oacute;n Ministerial N&ordm; 215-2015-MINEDU. Manual de Operaciones de la Direcci&oacute;n Regional de Educaci&oacute;n de Lima Metropolitana</a></p>\r\n\r\n<p><strong>Art&iacute;culo 36.- Direcci&oacute;n de la UGEL</strong></p>\r\n\r\n<p>Est&aacute; a cargo de un Director, quien es la m&aacute;xima autoridad administrativa de la UGEL de Lima Metropolitana. Es responsable de la gesti&oacute;n de la educaci&oacute;n b&aacute;sica regular, especial, alternativa y t&eacute;cnico-productiva y de supervisar el servicio educativo brindado por las instituciones educativas.</p>\r\n\r\n<p><strong>Art&iacute;culo 37.- Funciones de la Direcci&oacute;n de la UGEL</strong></p>\r\n\r\n<p>Son funciones de la Direcci&oacute;n de la UGEL:</p>\r\n\r\n<p>a) Dirigir y evaluar la implementaci&oacute;n de la pol&iacute;tica educativa nacional y normativa emitida por el MINEDU, en el &aacute;mbito de la competencia de la UGEL.<br />\r\nb) Supervisar la gesti&oacute;n de las instituciones educativas bajo la jurisdicci&oacute;n de la&nbsp;UGEL; as&iacute; como coordinar y supervisar la implementaci&oacute;n de acciones de mejora, seg&uacute;n corresponda.<br />\r\nc) Dirigir las acciones necesarias para brindar soporte pedag&oacute;gico, administrativo y log&iacute;stico a las instituciones educativas p&uacute;blicas bajo la jurisdicci&oacute;n de la UGEL.<br />\r\nd) Brindar a la DRELM informaci&oacute;n oportuna para el proceso de elaboraci&oacute;n del&nbsp;presupuesto de la UGEL a su cargo.<br />\r\ne) Dirigir, hacer seguimiento y supervisar la gesti&oacute;n de los recursos asignados a la&nbsp;UGEL, danto cuenta a la DRELM.<br />\r\nf) Fomentar las relaciones interinstitucionales con las entidades p&uacute;blicas y privadas que trabajen a favor de la educaci&oacute;n, en el &aacute;mbito de la jurisdicci&oacute;n de la UGEL.<br />\r\ng) Resolver en primera instancia los procedimientos administrativos en el &aacute;mbito de&nbsp;su competencia.<br />\r\nh) Proponer a la DRELM, la creaci&oacute;n de redes educativas, en el &aacute;mbito de su competencia.<br />\r\ni) Implementar acciones en materia de transparencia, &eacute;tica p&uacute;blica y lucha contra&nbsp;la corrupci&oacute;n, en el marco de sus competencias y la normativa aplicable<br />\r\nj) Suscribir convenios de colaboraci&oacute;n interinstitucional con entidades del sector p&uacute;blico e instituciones del sector privado, que contribuyan a mejorar la calidad del servicio educativo en el &aacute;mbito de su competencia e informando a la DRELM<br />\r\nk) Expedir actos resolutivos en materia de su competencia.<br />\r\nl) Otras funciones que en el marco de su competencia, le sean asignadas .</p>\r\n', '2017-07-04 05:32:55', '2017-07-04 06:34:55', 1, 4, '', '', '', '', 0, '', NULL, 3, 3),
(35, 'Asesoría Jurídica', '<p>El &Aacute;rea de Asesor&iacute;a Jur&iacute;dica es responsable de emitir opini&oacute;n y asesorar sobre los asuntos de car&aacute;cter jur&iacute;dico de competencia de la&nbsp;Ugel de la Regi&oacute;n Hu&aacute;nuco</p>\r\n\r\n<h3>Funciones del &Aacute;rea de Asesor&iacute;a Jur&iacute;dica</h3>\r\n\r\n<p>El &Aacute;rea de Asesor&iacute;a Jur&iacute;dica tiene las siguientes funciones</p>\r\n\r\n<ol>\r\n	<li>Asesorar a la Direcci&oacute;n de la UGEL 304 - Ugel Pachitea de la Regi&oacute;n Hu&aacute;nuco en aspectos de car&aacute;cter jur&iacute;dico.</li>\r\n	<li>Asesorar y/o absolver las consultas de las instituciones educativas de educaci&oacute;n b&aacute;sica y t&eacute;cnico productiva, en materia jur&iacute;dica.</li>\r\n	<li>Emitir opini&oacute;n jur&iacute;dica sobre sobre los proyectos de actos resolutivos, convenios y contratos a ser suscritos por la Direcci&oacute;n de la UGEL de su jurisdicci&oacute;n.</li>\r\n	<li>Comunicar a la DRELM, para efectos de la sistematizaci&oacute;n, la normativa en materia educativa emitida en el &aacute;mbito de su jurisdicci&oacute;n.</li>\r\n	<li>Revisar y visar, o en su caso, modificar los proyectos de resoluciones, a ser suscritos por la Direcci&oacute;n de la UGEL de su jurisdicci&oacute;n.</li>\r\n	<li>Coordinar con la DRELM, la tramitaci&oacute;n de los asuntos a cargo de la Procuradur&iacute;a P&uacute;blica del MINEDU, en los que est&eacute; inmerso las instituciones educativas de su jurisdicci&oacute;n.</li>\r\n	<li>Otras funciones que en el marco de sus competencias, le sean asignadas por la Direcci&oacute;n de la UGEL.</li>\r\n</ol>\r\n\r\n<p>&nbsp;<strong>FUNCIONARIO A CARGO:</strong></p>\r\n', '2017-07-04 05:33:36', '2017-07-04 06:42:26', 1, 4, '', '', '', '', 0, '', NULL, 3, 3),
