(38, 1, '2018-05-06 23:02:30', '2018-05-06 23:02:30', 'Esta es una página de ejemplo, Es diferente a una entrada de un blog porque se mantiene estática y se mostrará en la barra de navegación (en la mayoría de temas). Casi todo el mundo comienza con una página Sobre mí para presentarse a los potenciales visitantes. Podría ser algo así:\r\n<blockquote>¡Hola!: Soy mensajero por el día, aspirante a actor por la noche y esta es mi web. Vivo en Madrid, tengo perrazo llamado Juan y me encantan las piñas coladas (y que me pille un chaparrón)</blockquote>\r\n… o algo así:\r\n<blockquote>La empresa Calcetines XYZ se fundó en 1971, y ha estado produciendo calcetines de calidad para sus clientes desde entonces. Ubicada en Gothan, la empresa XYZ tiene más de 2.000 empleados e intenta ayudar en lo que puede para mejorar la vida en Gothan</blockquote>\r\nSi eres nuevo en WordPress deberías ir a <a href="http://localhost/prueba/wp-admin/">tu escritorio</a> para borrar esta página y crear algunas nuevas con tu contenido. ¡Pásalo bien!', 'Inicio', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-05-06 23:02:30', '2018-05-06 23:02:30', '', 2, 'http://localhost/prueba/2018/05/06/2-revision-v1/', 0, 'revision', '', 0),
